class Solution:

    def getMaxSum(self, num:int, nums:List[int], i: int):
        maxSum = -10**10 
        if num not in nums[i+1:]:
            return maxSum
        
        idx = nums.index(num, i + 1)
        while idx:
            # print(nums[i:idx+1])
            # print(sum(nums[i:idx+1]))
            suma = sum(nums[i:idx+1])
            maxSum = max(maxSum, suma)

            if num not in nums[idx+1:]:
                break
            idx = nums.index(num, idx + 1)
        return maxSum


    def maximumSubarraySum(self, nums: List[int], k: int) -> int:
        seen = {}
        maxSum = -math.inf

        P = [0] + list(accumulate(nums))
        # print(P)

        for j, x in enumerate(nums):
            for y in x - k, x + k:
                if y in seen:
                    i = seen[y]
                    maxSum = max(maxSum, P[j+1] - P[i])
            if x not in seen or P[seen[x]] >= P[j]:
                seen[x] = j

        return maxSum if maxSum != math.inf else 0 
    
